// components/Header.js

import Link from 'next/link'
import Navbar from './Navbar.js'

const headerStyle = {
	padding: 20,
	border: '1px solid #DDD'
}

const Header = () => (
	<div style={headerStyle}>
		<Navbar />
	</div>
)

export default Header
